import React, {useEffect} from "react";
import {Link} from "react-router-dom";
import AlgorithmScreen from "./AlgorithmScreen";
import {useDispatch, useSelector} from "react-redux";

function ArrayMainScreen(props) {

    const algorithmList= useSelector(state => state.algorithmsList);
    const {algorithms, loading, error}= algorithmList;
    const dispatch= useDispatch();

    useEffect( () => {
        dispatch(algorithmList());

        return () => {
            //
        };
    }, [])

    return (
        <div className="test">
           <p>You are in the main of Array searching!</p>

            <ul>
                <li>
                    <Link to={AlgorithmScreen} id={1}>Sequential Search</Link>
                </li>
                <li>
                    <a href="#">Binary Search</a>
                </li>
                <li>
                    <a href="#">Quick sort</a>
                </li>
                <li>
                    <a href="#">Fibonacci Search</a>
                </li>
                <li>
                    <a href="#">Block Search</a>
                </li>
                <li>
                    <a href="#">Interpolation Search</a>
                </li>
                <li>
                    <a href="#">Algorithm#2</a>
                </li>
            </ul>
        </div>
    )
};

export default ArrayMainScreen;
